var title_f27_49_28432="GHVD rates with prophylaxis";
var content_f27_49_28432=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F79413&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F79413&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 611px\">",
"   <div class=\"ttl\">",
"    Rates of acute and chronic graft-versus-host disease following prophylaxis with cyclosporin and methotrexate with or without anti-T-cell globulin",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 591px; height: 545px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The figures depict crude and adjusted incidence rates of graft-versus-host disease (GVHD) in 202 patients with hematologic malignancies randomly assigned to receive GVHD prophylaxis with cyclosporin and methotrexate with or without anti-T cell globulin (ATG-F). Incidence rates are given for grade III-IV acute GVHD (A), grade II-IV acute GVHD (B), limited or extensive chronic GVHD (C), and extensive chronic GVHD (D). Adjusted rates are adjusted for disease status and stem-cell source.",
"    <div class=\"footnotes\">",
"     Lim/ext: limited/extensive.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Finke J, Bethge WA, Schmoor C, et al. Standard graft-versus-host disease prophylaxis with or without anti-T-cell globulin in haematopoietic cell transplantation from matched unrelated donors: a randomised, open-label, multicentre phase 3 trial. Lancet Oncol 2009; 10:855. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
