var title_f27_49_28433="Ectopic ureter pathogenesis";
var content_f27_49_28433=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F68944&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F68944&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 522px\">",
"   <div class=\"ttl\">",
"    Embryology of a complete uretal duplication and ectopic ureter",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 502px; height: 698px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic embryologic development of a complete duplex renal system with the formation of two ureteral buds. Note that the cranial ureteral bud drains the lower pole of the kidney and the caudal ureter bud the upper renal unit. In general, pathology occurs when the caudal ureteral bud inserts in an abnormal distal ectopic location in the bladder (ie, ectopic ureter) or caudal to the bladder causing upper pole ureteral obstruction. When the cranial ureter inserts abnormally, lower pole ureteral reflux can occur.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
