"     <div class=\"reference\">",
"      Metz DC, Buchanan M, Purich E, et al, &ldquo;A Randomized Controlled Crossover Study Comparing Synthetic Porcine and Human Secretins With Biologically Derived Porcine Secretin to Diagnose Zollinger-Ellison Syndrome,&rdquo;",
"      <i>",
"       Aliment Pharmacol Ther",
"      </i>",
"      , 2001, 15(5):669-76.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
