"  <div class=\"figure\" style=\"width: 559px\">",
"   <div class=\"ttl\">",
"    Food labels can be tricky",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 539px; height: 550px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    To figure out how much sodium you are eating, check the label to find out how much sodium is in one serving. If you are having more than one serving, multiply that amount by the number of servings you plan to eat. For instance, if you are going to eat this whole can of soup, you should multiply 850 by 2. That means that you will be having 1700 milligrams of sodium. That's more sodium than many people are supposed to have in one day.",
