var content_f27_49_28444=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F68740&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F68740&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Results of therapeutic phlebotomy in patients with hemochromatosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Complications of iron overload",
"       </td>",
"       <td class=\"subtitle1\">",
"        Expected treatment outcome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        Prevention of complications of iron overload; normal life expectancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Weakness, fatigue, lethargy",
"       </td>",
"       <td>",
"        Improvement in majority of patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated serum concentrations of hepatic enzymes",
"       </td>",
"       <td>",
"        Resolution or marked improvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatomegaly",
"       </td>",
"       <td>",
"        Resolution often occurs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatic cirrhosis",
"       </td>",
"       <td>",
"        No change",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased risk for primary liver cancer",
"       </td>",
"       <td>",
"        No change*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Right upper quadrant pain",
"       </td>",
"       <td>",
"        Resolution or marked improvement&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Arthropathy",
"       </td>",
"       <td>",
"        Improvement in arthralgias sometimes occurs; change in joint deformity is rare; progression is sometimes seen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypogonadotrophic hypogonadism",
"       </td>",
"       <td>",
"        Resolution is rare",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diabetes mellitus",
"       </td>",
"       <td>",
"        Occasional improvement, often temporary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypothyroidism, hypogonadism",
"       </td>",
"       <td>",
"        Resolution is rare",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiomyopathy",
"       </td>",
"       <td>",
"        Resolution sometimes occurs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperpigmentation",
"       </td>",
"       <td>",
"        Resolution usually occurs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperferritinemia",
"       </td>",
"       <td>",
"        Resolution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Excess absorption and storage of nonferrous metals&Delta;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Infection with Vibrio vulnificus or other bacteria",
"       </td>",
"       <td>",
"        Little or no change",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Increased risk occurs only in persons with cirrhosis.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Right upper quadrant pain in persons with hemochromatosis is often related to hepatic iron overload. In these cases, therapeutic phlebotomy usually results in marked improvement or resolution. However, right upper quadrant pain may also be caused by primary liver cancer, portal vein thrombosis, gallbladder disease, lesions in the hepatic flexure, or nephrolithiasis. Iron depletion alone will not alleviate right upper quadrant pain due to these causes.",
"      <br>",
"       &Delta; Cobalt, maganese, zinc, and lead.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Barton JC, et al. Ann Intern Med 1998; 129:932.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f27_49_28444=[""].join("\n");
