var title_f27_49_28445="Parenteral rx severe malaria";
var content_f27_49_28445=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F79194&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F79194&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Therapeutic options for parenteral treatment of severe malaria*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        I. Artemisinin derivative",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Artesunate",
"       </td>",
"       <td>",
"        2.4 mg/kg intravenously as first dose, followed by 2.4 mg/kg at 12 and 24 hours, followed by 2.4 mg/kg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        II. Quinine or quinidine",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Quinine dihydrochloride",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        16.7 mg base/kg (= 20 mg salt/kg) in 5 percent dextrose loading dose over 4 hours, followed by 25 mg base/kg/day (20 to 30 mg salt/kg/day) divided into 2 to 3 equal administrations of 8.35 mg base/kg (= 10 mg salt/kg) over 2 hours at 8 or 12 hr intervals (maximum 1800 mg salt/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Quinidine gluconate",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td>",
"        6.25 mg base/kg (= 10 mg salt/kg) loading dose intravenously (maximum 600 mg salt) in normal saline over 1-2 hrs, followed by 0.0125 mg base/kg/min (= 0.02 mg salt/kg/minute) continuous infusion for at least 24 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alternative: 15 mg base/kg (= 24 mg salt/kg) loading dose intravenously in normal saline over 4 hrs, followed by 7.5 mg base/kg (= 12 mg salt/kg) infused over 4 hrs every 8 hrs, starting 8 hrs after the beginning of the loading dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"2\">",
"        <strong>",
"         PLUS",
"        </strong>",
"        * one of the following: Doxycycline, Tetracycline or Clindamycin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Doxycycline",
"       </td>",
"       <td>",
"        Adults: 100 mg orally twice daily. Children: 2.2 mg/kg (up to 100 mg) orally twice daily. Intravenous dosing acceptable if oral medication not tolerated; switch to oral dosing once patient is able to swallow. Treatment course is 7 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Tetracycline",
"       </td>",
"       <td>",
"        Adults: 250 mg orally four times daily. Children: 25 mg/kg/day (up to 1000 mg) divided into 4 equal doses. Treatment course is 7 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Clindamycin",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        Adults and children: 20 mg base/kg/day orally (maximum 1800 mg) divided into 3 equal doses. Treatment course is 7 days.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * In general, parenteral therapy is administered for severe disease. Once the patient is able to tolerate oral medications, treatment may be completed orally. Options include:",
"     <strong>",
"      1.",
"     </strong>",
"     Parenteral artesunate followed by atovaquone-proguanil (for adults: 4 adult tabs orally for 3 days), mefloquine (for adults: 750 mg salt orally as initial dose followed by 500 mg salt orally 6 to 12 hrs later), doxycycline or clindamycin.",
"     <strong>",
"      2.",
"     </strong>",
"     Parenteral quinine (or quinidine) with doxycycline, tetracycline or clindamycin (7 days therapy total); this is common practice for patients with malaria acquired in SE Asia, if artesunate is not available.",
"     <strong>",
"      3.",
"     </strong>",
"     Parenteral quinine (at least three doses) until the patient is able to swallow, followed by oral therapy with an artemisinin combination drug such as artemether-lumefantrine (3 days therapy total; see separate table summarizing oral artemisinin combination therapy); this is common practice for children with malaria acquired in Africa, if artesunate is not available.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Artesunate can also be administered intramuscularly, orally, or via rectal suppository (100 mg for children 6 months to 6 years of age; 400 mg for children &gt;6 years). In the United States intravenous artesunate is not approved by the Food and Drug Administration but is available for emergency use under an investigational protocol by enrollment with the Centers for Disease Control (CDC). Artesunate is unstable in solution so is dispensed as a dry powder of artesunic acid together with an ampule of diluent (5 percent sodium bicarbonate solution or sodium phosphate solution as supplied by US CDC). The powder and liquid are mixed to provide a concentration of 10 mg/mL; the artesunate solution should be administered within one hour of preparation. Once the patient has received four doses of intravenous artesunate and is able to swallow, the treatment can be completed with a course of an active oral antimalarial drug based on known susceptibility data.",
"      <br>",
"       &Delta; Important adverse effects include hypoglycemia, QT prolongation, tinnitus, reversible hearing loss, nausea, vomiting, dizziness and visual disturbances. To avoid cardiotoxicity, a loading dose of quinine/quinidine should not be administered to patients who received mefloquine or other quinine derivatives within the previous 12 hours.",
"       <br>",
"        <span class=\"lozenge\">",
"         &loz;",
"        </span>",
"        Quinine should be given by rate controlled intravenous infusion and never by intravenous injection (which can be lethal). Quinine can also be administered via intramuscular injection if intravenous infusions cannot be given: two injections of 10 mg/kg quinine (diluted to 60 mL) should be administered four hours apart. The anterior thigh is preferred over the gluteal region to minimize the risk of sciatic nerve damage.",
"        <br>",
"         &sect; In the United States, intravenous quinidine is available for treatment of severe malaria. Quinidine can cause QT prolongation and should be administered by rate controlled intravenous infusion with continuous electrocardiographic and hemodynamic monitoring in an intensive care unit. Quinidine may be significantly absorbed to PVC tubing; tubing length should be minimized to approximately 12 inches.",
"         <br>",
"          &yen; Clindamycin should be administered for pregnant women; doxycycline and tetracycline are contraindicated.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     CDC Malaria Hotline: (770) 488-7788 Monday-Friday 8a to 4:30p EST; (770) 488-7100 after hours, weekends and holidays.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
