"     <br>",
"      Additional data from: Basch E, Prestrud AA, Hesketh PJ, et al. Antiemetics: American Society of Clinical Oncology Clinical Practice Guideline Update. J Clin Oncol 2011; 21:4189.",
"     </br>",
"    </div>",
